DROP PROCEDURE IF EXISTS assignTenantToAllUsers;

DELIMITER $$
CREATE PROCEDURE assignTenantToAllUsers()
  BEGIN
    DECLARE totalUsersRows INT DEFAULT 0;
    DECLARE i INT DEFAULT 0;
    SELECT COUNT(*) FROM users INTO totalUsersRows;
    SET i=0;
    WHILE i < totalUsersRows DO
      SET i = i + 1;
    END WHILE;
END; $$
DELIMITER ;

CALL assignTenantToAllUsers();
